import React from 'react';
import logo from './logo.svg';
import './App.css';
import ProjectPreview from "./ProjectPreview"

function App() {
  return (
    <div className="app">


      <div className="landing-page">
        <header className="app-header">
          <p className="nav-header">Welcome</p>
          <p className="header1 landing_title">I'm Cathleen. I'm a designer - developer.</p>
          <p className="header1 landing_text">I create radically different digital experiences to empower people and enable ideas.</p>
        </header>

        <div className="projects">
          <ProjectPreview name="Uber" description="Product design" imgUrl={require("./assets/uber-preview.png")}/>
        </div>

      </div>


      <div className="side-nav">
        <div className="navbar">
          <div className="navbar-01"/>
          <div className="navbar-02"/>
        </div>
        <p className="nav-email">cathleenjia@berkeley.edu</p>
      </div>


    </div>
  );
}

export default App;
